import { Injectable } from '@angular/core';
import { User } from './model/user';

@Injectable({
  providedIn: 'root'
})
export class UserService {
  private nextId = 1;
   users: User[] = [
    { id: this.nextId++, firstName: 'Denis', lastName: 'LN_Test1', username: 'DeDa' },
    { id: this.nextId++, firstName: 'Guillaume', lastName: 'Venier', username: 'GuVe' }
  ];

  getUsers(): User[] {
    return this.users;
  }

  addUser(firstName: string, lastName: string, username: string): void {
    const user: User = { id: this.nextId++, firstName, lastName, username };
    this.users.push(user);
  }

  deleteUser(user: User): void {
    const index = this.users.findIndex(u => u.id === user.id);
    if (index >= 0) {
      this.users.splice(index, 1);
    }
  }

  setName(firstName: string, lastName: string): void {
    firstName = firstName;
    lastName = lastName;
  }
}
